★理想的な水中姿勢をサポート！エクサーフラットブイ<br>
<br>
●体を水平な姿勢に保つことで、水の抵抗を少なく省エネルギーに泳ぐというフラットスイムの理論に注目。<br>
腰に装着する事により腰が浮き、理想的な水中姿勢を保つトレーニングをサポート。<br>
●４泳法に対応し、ターンもできる"泳げるブイ"。フィット性の高い独自のストラップをつけ、体に密着するように設計。<br>
●ベルトを緩み無くしっかり締める事により、エクサーフラットブイ本来の機能が活かされます。<br>
<br>
■素材<br>
本体：発泡ポリエチレンEVA<br>
ベルト：ナイロン、ポリプロピレン<br>
<br>
※商品の色の見え方と実物の色は、パソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。 

<BR>
<BR>
■サイズ：240×240×60mm<br>
※適合ウエスト 55-100cm<br><br>
